public class TwoStrings {
	    private String up;
	    private String down;

	    public TwoStrings(String up, String down) {
	        this.up = up;
	        this.down = down;
	    }

		public String getLeft() {
			// TODO Auto-generated method stub
			return up;
		}

		public String getRight() {
			// TODO Auto-generated method stub
			return down;
		}
}
